export default (state = '', action) => {
  switch (action.type) {
    
    case 'INDEX_ME':
      return action.payload.map(  (me) =>
        <li key={me[0]}> 
          {me[0]}
          {me[1]}
          {me[2]}
        </li>
      );

    default:
      return state;
  }
}
